import React, { Fragment } from "react";
import Landing from "../component/Landing";
import Newfilms from "../component/Newfilms/Newfilms";
import Bestfilm from "../component/Newfilms/Bestfilm";

const Home = (props) => {
   const filmitem=props.ones.filter(ones=>one.rate > 1).map((movie)=>{
  return(
    <Fragment>
     <Productfilm name={movie.name} url={movie.image} rate={movie.rate} />
     
     </Fragment>
   )
     })


  return <Fragment>
        <Landing  />
     <Newfilms new={props.ones} />
     <Bestfilm/>
  </Fragment>;
};
export default Home;
